import React from "react";
import AuthService from "../services/auth.service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import bg from "../images/wbg.jpg";
import images1 from "../images/social.JPG";
let p = localStorage.getItem("username");
let j = localStorage.getItem("jwt");
const Profile = () => {
  const navigate = useNavigate();
  const logOut = () => {
    AuthService.logout();
    navigate("/");
  };
  const [user, setFaculty] = useState([]);
  const init = () => {
    AuthService.getUser(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    init();
  }, []);
  return (
    <div
      className="profilepage"
      style={{
        backgroundImage: "url(" + bg + ")",
        backgroundSize: "cover",
        height: "40rem",
        width: "84.3rem",
      }}
    >
      {/* <header className="jumbotron">
        <h3>
          <strong>{user.username}</strong> Profile
        </h3>
      </header>
      <p>
        <strong>Token:{j}</strong>
      </p>
      <p>
        <strong>Id:</strong> {user.id}
      </p>
      <p>
        <strong>Email:</strong> {user.emailId}
      </p>
      <strong>Authorities:</strong>
      <ul>{user.roles}</ul>
      <ul>
        <button
          className="btn btn-danger ml-2"
          onClick={() => {
            logOut();
          }}
        >
          LOGOUT
        </button>
      </ul> */}

      <div
        className="profilepage"
        style={{
          backgroundImage: "url(" + bg + ")",
          backgroundSize: "cover",
          height: "40rem",
          width: "84.3rem",
        }}
      >
        <div class="profilepage">
          <div class="col-sm-3 sidenav">
            <h2
              style={{
                fontFamily: "monotype corsiva",
                paddingLeft: "95px",
                color: "white",
              }}
            >
              Welcome
            </h2>
            <h3
              style={{
                color: "white",
                paddingLeft: "35px",
                paddingTop: "10px",
              }}
            >
              <strong>{user.username}</strong>
            </h3>
            {/* 
            <p
              class="active"
              style={{
                color: "white",
                paddingLeft: "35px",
              }}
            >
              Dashboard
            </p> */}
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Email:</strong> {user.emailId}
            </p>
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Age:</strong> {user.age}
            </p>
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Gender:</strong> {user.gender}
            </p>
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Contact No:</strong> {user.ph_no}
            </p>
            <br></br>
            <button
              style={{ marginLeft: "78px" }}
              className="btn btn-danger ml-2"
              onClick={() => {
                logOut();
              }}
            >
              LOGOUT
            </button>
          </div>
        </div>
      </div>
       <div class="col-sm-9">
      <div class="well">
        <h4>Dashboard</h4>
        <p>Some text..</p>
      </div>
      <div class="row">
        <div class="col-sm-3">
          <div class="well">
            <h4>Users</h4>
            <p>1 Million</p> 
          </div>
        </div>
        <div class="col-sm-3">
          <div class="well">
            <h4>Pages</h4>
            <p>100 Million</p> 
          </div>
        </div>
        <div class="col-sm-3">
          <div class="well">
            <h4>Sessions</h4>
            <p>10 Million</p> 
          </div>
        </div>
        <div class="col-sm-3">
          <div class="well">
            <h4>Bounce</h4>
            <p>30%</p> 
          </div>
        </div>
      </div>
      <div class="row">
        <div class="col-sm-4">
          <div class="well">
            <p>Text</p> 
            <p>Text</p> 
            <p>Text</p> 
          </div>
        </div>
        <div class="col-sm-4">
          <div class="well">
            <p>Text</p> 
            <p>Text</p> 
            <p>Text</p> 
          </div>
        </div>
        <div class="col-sm-4">
          <div class="well">
            <p>Text</p> 
            <p>Text</p> 
            <p>Text</p> 
          </div>
        </div>
      </div>
      <div class="row">
        <div class="col-sm-8">
          <div class="well">
            <p>Text</p> 
          </div>
        </div>
        <div class="col-sm-4">
          <div class="well">
            <p>Text</p> 
          </div></div></div></div>
      <footer id="footer">
        <ul class="navbar-nav">
          <li>
            Get connected with us on
            <img
              src={images1}
              alt="My Image"
              style={{ height: "3rem", width: "27rem" }}
            />
          </li>
        </ul>
      </footer>
    </div>
  );
};
export default Profile;
